from math import floor

def GCD(a, b):
    if a <= b:
        (a, b) = (b, a)
    while True:
        if a % b == 0:
            return b
        (a, b) = (b, a % b)

def GCDEx(a, b):
    if b == 0:
        return (1, 0)
    (sx, sy) = GCDEx(b, a % b)
    return (sy, sx - a // b * sy)

def closest(t):
    if abs(t - floor(t)) > 0.5:
        return floor(t) + 1
    else:
        return floor(t)

def find_closest_point(a, b, c):
    gcd = GCD(a, b)
    a //= gcd
    b //= gcd
    c //= gcd
    (sx, sy) = GCDEx(a, b)
    t1 = floor(-sx * c / b) + 1
    t2 = c * (a * sy - b * sx) / (a * a + b * b)
    if t1 >= t2:
        t = t1
    else:
        t = closest(t2)
    return (sx * c + t * b, sy * c - t * a)

